(317, 1, '2025-04-07 09:57:29', '2025-04-07 09:57:29', '<!-- wp:acf/character {\"name\":\"acf/character\",\"data\":{\"introduction\":\"Anne after being reborn as a winter spirit upon receiving some gifts from Rupee. Rupee’s infectious positive energy has made her more cheerful and optimistic than ever before.\",\"_introduction\":\"field_67efd514b121b\",\"review_text\":\"\\u003cp\\u003eAs it has been a long time since the initial analysis of Anne: Miracle Fairy and in light of the ever-evolving meta, the dedicated review has been hidden. Furthermore, Anne: Miracle Fairy has fallen out of fashion when it comes to PVE content. Consider using other higher-ranked units from our tier list if possible. The character is part of the meta in PVP. For more information, visit our PVP meta guide.\\u003c/p\\u003e\",\"_review_text\":\"field_67f232bfcf231\",\"skill_investment_pve\":\"\\u003cp class=\\u0022inline\\u0022\\u003e\\r\\n\\u003cstrong class=\\u0022yellow inline\\u0022\\u003e1/1/1\\u003c/strong\\u003e → \\u003cstrong class=\\u0022red inline\\u0022\\u003e4/4/4\\u003c/strong\\u003e (→ \\u003cstrong class=\\u0022purple inline\\u0022\\u003e4/4/7\\u003c/strong\\u003e)\\r\\n\\u003c/p\\u003e\",\"_skill_investment_pve\":\"field_67f24ac6f4d91\",\"skill_investment_pvp\":\"\\u003cp\\u003e\\r\\n\\u003cstrong class=\\u0022yellow\\u0022\\u003e1/1/1\\u003c/strong\\u003e → \\u003cstrong class=\\u0022blue\\u0022\\u003e4/4/4\\u003c/strong\\u003e → \\u003cstrong class=\\u0022red\\u0022\\u003e4/4/7\\u003c/strong\\u003e (→ \\u003cstrong class=\\u0022purple\\u0022\\u003e4/4/10\\u003c/strong\\u003e)\\r\\n\\u003c/p\\u003e\",\"_skill_investment_pvp\":\"field_67f24b01f4d94\",\"skill_investment_priority\":\"\\u003cp class=\\u0022yellow\\u0022\\u003e-\\u003c/p\\u003e\",\"_skill_investment_priority\":\"field_67f24ac6f4d92\",\"skill_investment\":\"\",\"_skill_investment\":\"field_67f24ac6f4d8e\",\"gear_investment_essential\":\"\\u003cp\\u003e-\\u003c/p\\u003e\",\"_gear_investment_essential\":\"field_67